import React, { Component } from 'react';
import ig from "../pictures/ridge.jpg"
import fb from "../pictures/port.jpg"

class FoldOverItem3 extends Component {
    render() {
return(
      <div className="linksContainer">
      <a  href={'https://www.lafitness.com/pages/ClassSchedulePrintVersion.aspx?clubid=695&Yonkers-New%20York'} alt="James Medina JWM Porfolio">
       <img  className="linkStyle" src={ig}/><br/>
        <br />
          <br/>
       </a><br/>
       <a href={'https://www.facebook.com/yogijwm'} alt="James Medina JWM Porfolio">
        <img  className="linkStyle" src={fb}/><br/>
         <br />
           <br/>
        </a>

      </div>
    )
  }
}

export default FoldOverItem3;
